export class Search extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            plants: [],
            // isLoaded: false,
            message: ''
        }
    }

    render() {
            return (
                <div>
                    <SearchBar/>
                    <ResultGroup plants={this.state.plants} />
                </div>
            )
    }
}
